            <ol><li>Ce site est le premier outil. Il permet une gestion des horaires et la modification de certains paramètres. L&#39;admin peut toujours manuellement modifier un horaire depuis ici.</li> <li><a href="https://shiftswitch.pockethost.io/_/#/collections?collectionId=_pb_users_auth_&amp;filter=&amp;sort=-created" class="link svelte-6gmijs">Pocketbase</a> est utilisé comme &quot;Backend&quot; et gère les données et l&#39;authentification. Depuis le panneau de contrôle de Pocketbase, il est possible de modifier tous les paramètres et données. S&#39;il est nécessaire d&#39;ajouter un nouveau GB, réinitialiser un mot de passe, ... il faut le faire sur Pocketbase.</li> <li><a href="https://github.com/Engollon/shiftswitch" class="link svelte-6gmijs">Github</a> est utilisé pour gérer le code du site et pour distribuer le site. Le site est public sur Github. À cause de cela, il est préférable de ne pas avoir de données sensibles sur le site (Ceci est une précaution, le site est en soi sécurisé).</li></ol>
